VALUES ('000084', 'Career-Technical-Adult Education Displaced Homemaker Indicator', 'CTE-AE Displaced Homemaker Indicator', 'A person who ; (A) (i) has worked primarily without remuneration to care for a home and family, and for that reason has diminished marketable skills;    (ii) has been dependent on the income of another family member but is no longer supported by that income; or    (iii) is a parent whose youngest dependent child will become ineligible to receive assistance under part A of title IV of the Social Security Act (42 U.S.C. 601 et seq.) not later than 2 years after the date on which the parent applies for assistance under such title; and (B)   is unemployed or underemployed and is experiencing difficulty in obtaining or upgrading employment.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11084', '7', '11084')
