VALUES ('000128', 'Grade Point Average Cumulative', 'GPA - Cumulative', 'A measure of average performance in all courses taken by a person during his or her school career as determined for record-keeping purposes. This is obtained by dividing the total grade points received by the total number of credits attempted. This usually includes grade points received and credits attempted in his or her current school as well as those transferred from schools in which the person was previously enrolled.', 'Numeric - up to 4 digits after decimal place', '0', 'Related Connection; linked to Grade Point Average Weighted Indicator, High School Percentile, High School Rank, and Size of High School Graduating Class', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11128', '7', '11128')
