VALUES ('000143', 'Hire Date', NULL, 'The year, month and day on which a person was hired for a position, or consecutive positions within the same organization and job classification.', 'YYYY-MM-DD', '0', 'This is the Hire Date beginning consecutive employment with the current employer in the same Professional-Educational Job Classification. A person may change positions within the same organization and job classification without triggering a new hire date. For example a teacher originally hire to teach 3rd grade may be reassigned to 4th grade.  However, a change of job classifications, e.g. from teacher to principal, would trigger a new Hire Date.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11143', '7', '11143')
