VALUES ('000179', 'Limited English Proficiency - Postsecondary', 'LEP - Postsecondary', 'The term "individual with limited English proficiency" means a secondary school student, an adult, or an out-of-school youth, who has limited ability in speaking, reading, writing, or understanding the English language AND whose native language is a language other than English; OR who lives in a family or community environment in which a language other than English is the dominant language. ', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11179', '7', '11179')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000180', 'Limited English Proficiency Status', 'LEP Status', 'Used to indicate persons (A) who are ages 3 through 21;
(B) who are enrolled or preparing to enroll in an elementary school or a secondary school;
(C ) (who are I, ii, or iii)              
(i) who were not born in the United States or whose native languages are  languages other than English;
(ii) (who are I and II)
(I) who are a Native American or Alaska Native, or a native resident of the outlying areas; and 
(II) who come from an environment where languages other than English have a significant impact on their level of language proficiency; or
(iii) who are migratory, whose native languages are languages other than English, and who come from an environment where languages other than English are dominant; and
(D) whose difficulties in speaking, reading, writing, or understanding the English language may be sufficient to deny the individuals  (who are denied I or ii or iii) 
(i) the ability to meet the state''s proficient level of achievement on state assessments described in section 1111(b)(3);
(ii) the ability to successfully achieve in classrooms where the language of instruction is English; or
(iii) the opportunity to participate fully in society.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11180', '7', '11180')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000181', 'Magnet or Special Program Emphasis School', NULL, 'A school that has been designed: 1) to attract students of different racial/ethnic backgrounds for the purpose of reducing, preventing, or eliminating racial isolation; and/or 2)to provide an academic or social focus on a particular theme (e.g., science/math, performing arts, gifted/talented, career academy or foreign language).', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11181', '7', '11181')
