VALUES ('000245', 'Assessment Result Score Value', NULL, 'A meaningful raw score, derived score, or statistical expression of the performance of a person on an assessment. The type of result is indicated by the Assessment Score Metric Type element. The results can be expressed as a number, percentile, range, level, etc. The score relates to all scored items or a sub test scoring one aspect of performance on the test. This value may or may not correspond to one or more Performance Levels.', 'Alphanumeric - 35 characters maximum', '0', 'Information for interpreting the score is defined by elements in the related Assessment Subtest entity.  This includes the minimum, maximum, and optimal values for the measurement. Assessment Subtest defines information for scoring an Assessment Form, which may be for the entire assessment or one aspect of evaluation. The Assessment Subtest may in turn be associated with one or more content standards using the Learning Standard Item Association entity.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11245', '7', '11245')
