VALUES ('000616', 'Grade Value Qualifier', NULL, 'The scale of equivalents, if applicable, for grades awarded as indicators of performance in schoolwork. For example, numerical equivalents for letter grades used in determining a student''s Grade Point Average (A=4, B=3, C=2, D=1 in a four-point system) or letter equivalents for percentage grades (90-100%=A, 80-90%=B, etc.)', 'Alphanumeric - 100 characters maximum', '0', 'A list of "Academic Grade Qualifiers" is available from the Association of American Medical Colleges, 2450 N St., N.W., Washington, DC 20037', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11609', '7', '11609')
