VALUES ('000625', 'Program Identifier', NULL, 'A unique number or alphanumeric code assigned to a program by a school, school system, a state, or other agency or entity.', 'Alphanumeric - 40 characters maximum', '0', 'CEDS "Identifier" elements reflect the intent of the XSD:Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11618', '7', '11618')
