VALUES ('000689', 'Competency Framework Item Identifier', 'Learning Standard Item Identifier', 'The globally unique identifier (GUID) issued by the publisher of the competency framework that uniquely identifies the item in the hierarchy of competency framework items using a RFC 4122 compliant 32-character hexadecimal string, such as 21EC2020-3AEA-1069-A2DD-08002B30309D.', 'Alphanumeric - 40 characters maximum', '0', 'CEDS "Identifier" elements reflect the intent of the XSD:Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces.  &lt;BR/&gt;&lt;BR/&gt;An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11666', '7', '11666')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000690', 'Competency Framework Item Statement', 'Learning Standard Item Statement', 'The text of the statement. The textual content that either describes a specific competency or describes a less granular group of competencies within the taxonomy of the competency framework.', 'Alphanumeric', '0', 'Note: This element is designed to support statements from various learning standards frameworks. The Head Start Child Outcomes Framework includes statements for Domains, Elements, and Indicators. Examples from the K-12 Common Core State Standards are the domain: “Geometry", the cluster: “Understand and apply the Pythagorean Theorem,” and standard:  “Apply the Pythagorean Theorem to determine unknown side lengths in right triangles in real-world and mathematical problems in two and three dimensions.”', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11667', '7', '11667')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000691', 'Competency Framework Item Type', 'Learning Standard Item Type', 'The textual label identifying the class of the statement as designated by the promulgating body—e.g., "Standard," "Benchmark," "Strand," or "Topic." or "Level 1, Level 2,..."', 'Alphanumeric - 60 characters maximum', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11668', '7', '11668')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000692', 'Competency Framework Item Code', 'Learning Standard Item Code', 'A human-referenceable code designated by the publisher to identify the item in the hierarchy of competency framework items.', 'Alphanumeric - 30 characters maximum', '0', 'For example: "M.1.N.3"  The code is usually not globally unique and usually has embedded meaning such as a number that represents a grade/level and letters that represent content strands.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11669', '7', '11669')
