VALUES ('000732', 'Instructional Staff Status', NULL, 'Staff whose primary function/occupational activity is primarily instruction or instruction combined with research and/or public service.  Does not include medical school staff.', NULL, '1', 'As defined in IPEDS.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11709', '7', '11709')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000733', 'Medical School Staff Status', NULL, 'Staff employed by or employees working in the medical school component of a postsecondary institution or in a free standing medical school.  Does not include staff employed by or employees working strictly in a hospital associated with a medical school or those who work in health or allied health schools or departments such as dentistry, veterinary medicine, nursing or dental hygiene.', NULL, '1', 'As defined in IPEDS.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11710', '7', '11710')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000734', 'Faculty Status', NULL, 'Persons identified by the institution as such and typically those whose initial assignments are made for the purpose of conducting instruction, research or public service as a principal activity (or activities). They may hold academic rank titles of professor, associate professor, assistant professor, instructor, lecturer or the equivalent of any of those academic ranks. Faculty may also include the chancellor/president, provost, vice provosts, deans, directors or the equivalent, as well as associate deans, assistant deans and executive officers of academic departments (chairpersons, heads or the equivalent) if their principal activity is instruction combined with research and/or public service. The designation as "faculty" is separate from the activities to which they may be currently assigned. For example, a newly appointed president of an institution may also be appointed as a faculty member. Graduate, instruction, and research assistants are not included in this category.', NULL, '1', 'As defined in IPEDS.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11711', '7', '11711')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000735', 'Instructional Staff Contract Length', NULL, 'The contracted teaching period for faculty.', NULL, '1', 'Option set new for IPEDS in 2012 survey year; IPEDS does not include the Less than 9-month code', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11712', '7', '11712')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000736', 'Full-time Status', NULL, 'An indication of whether an individual is employed for a standard number of hours (as determined by civil or organizational policies) in a week, month, or other period of time.', NULL, '1', 'Postsecondary: The type of appointment at the snapshot date determines whether an employee is full-time or part-time.  The employee''s term of contract is not considered in making the determination of full or part-time.  Causal employees (hired on an ad-hoc basis or occasional basis to meet short-term needs) and students in the College Work-Study Program (CWS) are not considered part-time staff.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11713', '7', '11713')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000737', 'Contract Type', NULL, 'The type of employment contract used by an institution.', NULL, '1', 'Option set defined in IPEDS', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11714', '7', '11714')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000738', 'Tenure System', NULL, 'An indicator of whether an institution has personnel positions that lead to consideration for tenure.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11715', '7', '11715')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000739', 'Instructional Staff Faculty Tenure Status', NULL, 'An indicator of the type of faculty status a person has if, by institutional definition, a staff member has faculty status.', NULL, '1', 'Option set defined in IPEDS', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11716', '7', '11716')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000740', 'Academic Rank', NULL, 'The academic rank of staff whose primary responsibility is instruction, research, and/or public service.  Institutions without standard academic ranks should code staff whose primary responsibility is instruction, research, and/or public service as "No Academic Rank."', NULL, '1', 'Element definition and option set defined in IPEDS.  Adjunct is not included since it can be determined from a combination of the elements Instructional Staff Faculty Tenure Status and Full-time Status.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11717', '7', '11717')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000741', 'Instruction Credit Type', NULL, 'A designation of the type(s) of instruction being delivered by staff whose primary responsibility is instruction.  Instruction that is for "credit" can be applied toward the requirements for a postsecondary degree, diploma, certificate or other formal award.', NULL, '1', 'Element definition and option set defined in IPEDS; new collection element for the 2012 survey year', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11719', '7', '11719')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000742', 'Graduate Assistant Status', NULL, 'Graduate-level students employed on a part-time basis, not limited to, but often employed for the primary purpose of assisting in classroom or laboratory instruction or in the conduct of research.  Graduate students having titles such as graduate assistant, teaching assistant, teaching associate, teaching fellow, or research assistant typically hold these positions.', NULL, '1', 'As defined in IPEDS', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11720', '7', '11720')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000743', 'Graduate Assistant IPEDS Occupation Category', NULL, 'The Integrated Postsecondary Education Data System (IPEDS) occupational categories used to report graduate assistants.', NULL, '1', 'Option set defined in IPEDS', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11721', '7', '11721')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000744', 'Annual Base Contractual Salary', NULL, 'The total annual base contractual salary of a person.', 'Integer - greater than or equal to 0', '0', 'As defined in IPEDS', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11722', '7', '11722')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000745', 'Tuition - Published', NULL, 'The published tuition for first time, full-time undergraduate students (lower of in-district or in-state for public institutions).  Tuition may be charged per term, per course, per credit or per program.', 'Numeric - up to 2 digits after decimal place', '0', 'The tuition rate used in the calculation of the institutional "net price" of attendance.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11723', '7', '11723')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000746', 'Tuition Unit', NULL, 'The component for which tuition is being charged.  It might be a time period (term, quarter, year, etc.) or it might be an entity of education (course, credit hour, etc.).', NULL, '1', 'As defined in IPEDS', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11725', '7', '11725')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000747', 'Required Student Fees', NULL, 'Fixed sum charged to persons for items not covered by tuition and required of such a large proportion of all students that the student who does not pay the charge is the exception.', 'Numeric - up to 2 digits after decimal place', '0', 'As defined in IPEDS', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11726', '7', '11726')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000748', 'Institutionally Controlled Housing Status', NULL, 'An indication of whether an institution has any residence hall or housing facility located on- or off-campus that is owned or controlled by an institution and used by the institution in direct support of or in a manner related to, the institution''s educational purposes.', NULL, '1', 'As defined in IPEDS', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11727', '7', '11727')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000749', 'Room Charges', NULL, 'The charges for an academic year for rooming accommodations for a typical student sharing a room with one other student.', 'Numeric - up to 2 digits after decimal place', '0', 'As defined in IPEDS', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11728', '7', '11728')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000750', 'Board Charges', NULL, 'The charges assessed students for an academic year for the maximum meal plan available.', 'Numeric - up to 2 digits after decimal place', '0', 'As defined in IPEDS', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11729', '7', '11729')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000751', 'Books and Supplies Costs', NULL, 'The average cost for books and supplies for a typical student for an entire academic year (or program). Does not include unusual costs for special groups of students (e.g., engineering or art majors) unless they constitute the majority of students at an institution.', 'Numeric - up to 2 digits after decimal place', '0', 'As defined in IPEDS', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11730', '7', '11730')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000752', 'Other Student Expenses', NULL, 'The amount of money (estimated by the financial aid office) needed by a person to cover expenses such as laundry, transportation, and entertainment.', 'Numeric - up to 2 digits after decimal place', '0', 'As defined in IPEDS', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11731', '7', '11731')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000753', 'Price of Attendance', NULL, 'The total amount institutions estimate that undergraduate-level full-time, first-time degree-seeking students will pay to attend before financial aid is considered. This price includes tuition and fees, books and supplies, room and board, and certain other designated expenses such as transportation. These estimates are the average amounts used by the financial aid office to determine a student’s financial aid.', 'Numeric - up to 2 digits after decimal place', '0', 'As defined in IPEDS', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11732', '7', '11732')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000754', 'Comprehensive Fee', NULL, 'A single fixed amount of money charged by an institution that covers tuition, required fees, room, and board. For some institutions, this amount may also cover books and supplies.', 'Numeric - up to 2 digits after decimal place', '0', 'As defined in IPEDS', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11733', '7', '11733')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000755', 'Postsecondary Applicant', NULL, 'An individual who has fulfilled the institution’s requirements to be considered for admission (including payment or waiving of the application fee, if any) and who has been notified of one of the following actions: admission, nonadmission, placement on waiting list, or application withdrawn (by applicant or institution). Include early decision, early action, and students who began studies during summer in this cohort.', NULL, '1', 'CDS definition/instructions; first part matches IPEDS', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11735', '7', '11735')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000756', 'Admitted Student', NULL, 'Applicant who has been granted an official offer to enroll in a postsecondary institution. Admitted applicants should include wait-listed students who were subsequently offered admission.', NULL, '1', 'First sentence from IPEDS, not CDS; Second sentence from CDS instructions.  All options except "No" should be able to be collapsed into "Yes" for IPEDS reporting.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11736', '7', '11736')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000757', 'Wait Listed Student', NULL, 'A person who meets the admission requirements but will only be offered a place in the class if space becomes available.', NULL, '1', 'Common Data Set definition', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11738', '7', '11738')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000758', 'Grade Point Average Domain', 'GPA Domain', 'The domain to which the Grade Point Average is referencing.', NULL, '1', 'Used to indicate to which academic domain a grade point element is referencing', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11739', '7', '11739')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000759', 'High School Percentile', NULL, 'The High School Rank divided by the Size of High School Graduating Class expressed as a percentage.', 'Numeric - up to 3 digits before and 2 digits after decimal place', '0', 'Related Connection; linked to High School Grade Point Average Cumulative, Grade Point Average Weighted Indicator, High School Rank, and Size of High School Graduating Class&lt;BR/&gt;0% to 99% (where 99% corresponds to the valedictorian, 0% to the bottom rank in the class)', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11740', '7', '11740')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000760', 'Postsecondary Student Housing On-Campus', NULL, 'The student resides in a residence hall or housing facility owned or controlled by an institution within the same reasonably contiguous geographic area and used by the institution in direct support of or in a manner related to, the institution''s educational purposes.', NULL, '1', 'IPEDS Definition', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11741', '7', '11741')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000761', 'Fraternity Participation Status', NULL, 'Student is in membership of a chiefly social organization of men students at a college or university, usually designated by Greek letters.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11743', '7', '11743')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000762', 'Sorority Participation Status', NULL, 'Student is in membership in a chiefly social organization of women students at a college or university, usually designated by Greek letters.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11744', '7', '11744')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000763', 'Financial Aid Applicant', NULL, 'Any applicant who submits any one of the institutionally required financial aid applications/forms, such as the  Free Application for Federal Student Aid (FAFSA).', NULL, '1', 'Common Data Set definition.&lt;br/&gt;Element should be used in combination with Financial Aid Applicant Type.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11745', '7', '11745')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000765', 'Financial Need', NULL, 'The amount of financial need as determined by an institution using the federal methodology and/or your institution''s own standards.', 'Numeric - up to 2 digits after decimal place', '0', 'Common Data Set definition', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11747', '7', '11747')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000766', 'Teacher Education Test Company', NULL, 'The name of the company that provides the examination used in the teacher education program.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11748', '7', '11748')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000767', 'Teacher Preparation Program Enrollment Status', NULL, 'An indication of whether a person is pursuing certification as a teacher.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11749', '7', '11749')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000768', 'Teacher Preparation Program Completer Status', NULL, 'An indication of whether a person completed a state-approved teacher preparation program.  The fact that a person has or has not been recommended to the state for initial certification or licensure may not be used as a criterion for determining who is a program completer.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11750', '7', '11750')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000769', 'Alternative Route to Certification or Licensure', NULL, 'An indication of whether a person is enrolled in an alternative teacher preparation program as defined by Title II.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11751', '7', '11751')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000770', 'Critical Teacher Shortage Area Candidate', NULL, 'An indication of whether a person is pursuing licensure/certification in a field designated as a shortage area as defined by Title II.', NULL, '1', 'When used in conjunction with the element Classification of Instructional Program, the field of study can be determined.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11753', '7', '11753')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000771', 'Supervised Clinical Experience', NULL, 'An indication of whether a person is enrolled in a supervised clinical experience (including student teaching) as part of a teacher preparation program.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11754', '7', '11754')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000772', 'Supervised Clinical Experience Clock Hours', NULL, 'An indication of  the number of clock hours (minimum) a student is required to complete associated with a supervised clinical experience.', 'Integer - greater than or equal to 0', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11755', '7', '11755')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000773', 'Teacher Education Credential Exam Type', NULL, 'The type of examination used to assess teacher candidate''s knowledge and skills.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11756', '7', '11756')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000774', 'Teacher Education Credential Exam Score Type', NULL, 'An indication of the type of credential exam associated with a given exam score.', 'Alphanumeric - 30 characters maximum', '0', 'Praxis I: &lt;BR/&gt;Reading&lt;BR/&gt;Mathematics&lt;BR/&gt;Writing&lt;BR/&gt;&lt;BR/&gt;Praxis II:&lt;BR/&gt;Codes at http://www.ets.org/praxis/about/praxisii/content&lt;BR/&gt;&lt;BR/&gt;ACTFL codes at http://www.languagetesting.com/', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11757', '7', '11757')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000775', 'Low-income Status', NULL, 'A person who receives or is a member of a family who receives a total family income in the 6 months prior to enrollment of 70 percent of the income standard for a family of that size or that does not exceed the poverty line, or the person is receiving or is a member of a family who is receiving cash assistance payments from Federal, State, or local agencies or food stamps, or the person can be designated as homeless under the McKinney Act.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11758', '7', '11758')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000776', 'Dislocated Worker Status', NULL, 'An individual who has been terminated or laid off, or who has received a notice of termination or layoff from employment, or an individual who was self-employed but is unemployed as a result of general economic conditions in the community in which the individual resides or because of natural disasters.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11759', '7', '11759')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000777', 'Public Assistance Status', NULL, 'A person who receives financial assistance from Federal, State, or local government agencies, including Temporary Assistance for Needy Families or equivalent.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11760', '7', '11760')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000778', 'Rural Residency Status', NULL, 'A person who resides in a place with a population of less than 2,500 that is not near any metropolitan area with a population greater than 50,000, or in a city with adjacent areas of high density.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11761', '7', '11761')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000779', 'Adult Educational Functioning Level at Intake', NULL, 'An individual''s entering skill level, as defined by the National Reporting System for Adult Education and determined by an approved standardized assessment at program intake.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11763', '7', '11763')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000780', 'Adult Educational Functioning Level at Posttest', NULL, 'An individual''s skill level, as defined by the National Reporting System for Adult Education and determined by an approved standardized assessment after a set time period or number of instructional hours.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11764', '7', '11764')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000781', 'Adult Education Service Provider Identification System', NULL, 'A coding scheme that is used for identification and record-keeping purposes by schools, social services, or other agencies to refer to an institution.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11778', '7', '11778')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000782', 'Adult Education Special Program Type', NULL, 'The type, by location or delivery mode, of adult education instruction program in which an adult participates.', NULL, '1', 'Also see Adult Education Instructional Program Type', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11766', '7', '11766')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000783', 'Professional or Technical Credential Conferred', NULL, 'An indicator of the category of credential conferred by a state occupational licensing entity or industry organization for competency in a specific area measured by a set of pre-established standards.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11780', '7', '11780')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
