INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000862', 'Economic Research Service Rural-Urban Continuum Code', 'ERS Rural-Urban Continuum Code', 'Rural-Urban Continuum Codes form a classification scheme that distinguishes metropolitan (metro) counties by the population size of their metro area, and nonmetropolitan (nonmetro) counties by degree of urbanization and adjacency to a metro area or areas. The metro and nonmetro categories have been subdivided into three metro and six nonmetro groupings, resulting in a nine-part county codification. The codes allow researchers working with county data to break such data into finer residential groups beyond a simple metro-nonmetro dichotomy, particularly for the analysis of trends in nonmetro areas that may be related to degree of rurality and metro proximity.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11862', '7', '11862')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000863', 'Program Follows Salary Scale', NULL, 'An indication of whether a program has a salary scale that is followed for practitioners', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11863', '7', '11863')
