INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000869', 'Competency Framework Item Association Type', 'Learning Standard Item Association Type', 'Defines the nature of the association between a Competency Framework Item and an associated data object such as a Learning Resource, an Assessment Item, or even another Learning StandardCompetency Framework Item.', NULL, '1', 'The Learning Standard Item Association entity defines metadata relationships between a Learning Standard Item and other objects or relationships between Learning Standard Items not otherwise defined in the normal taxonomy of the framework such as for competency-based pathways, relationships between different versions of the same learning standard, and relationships to resources. &lt;br /&gt;&lt;BR/&gt;&lt;BR/&gt;For example, "Prerequisite" may indicate that the Associated Learning Standard Item is a Prerequisite of this Learning Standards Item.  Another association may specify that a Learning Resource "Teaches" the specified Learning Standard Item, or is aligned to the "Reading Level" specified as part of the Learning Standard Item.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11869', '7', '11869')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000870', 'Competency Framework Item Typical Age Range', 'Learning Standard Item Typical Age Range', 'The typical range of ages for the content’s intended end user.', 'Alphanumeric - 20 characters maximum', '0', 'E.g. "7-9"', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11870', '7', '11870')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000871', 'Competency Framework Item Association Identifier URI', 'Learning Standard Item Association Identifier URI', 'A URI that establishes uniqueness of an association between a competency framework item and another competency framework item or other objects such as learning resources.', 'Alphanumeric - 512 characters maximum', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11871', '7', '11871')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000872', 'Competency Framework Item Parent Identifier', 'Learning Standard Item Parent Identifier', 'The globally unique identifier (GUID) issued by the publisher of the competency framework that uniquely identifies the parent item in the hierarchy of competency framework items using a RFC 4122 compliant 32-character hexadecimal string, such as 21EC2020-3AEA-1069-A2DD-08002B30309D.', 'Alphanumeric - 40 characters maximum', '0', 'CEDS "Identifier" elements reflect the intent of the XSD:Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11872', '7', '11872')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000873', 'Competency Framework Item Parent Code', 'Learning Standard Item Parent Code', 'A human-referenceable code designated by the publisher to identify the parent item in the hierarchy of competency framework items.', 'Alphanumeric - 30 characters maximum', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11873', '7', '11873')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000874', 'Competency Framework Item URL', 'Learning Standard Item URL', 'A network-resolvable Uniform Resource Locator (URL) pointing to the authoritative reference for the competency framework item.', 'Alphanumeric - 512 characters maximum', '0', 'An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11874', '7', '11874')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000875', 'Competency Framework Item Blooms Taxonomy Domain', 'Learning Standard Item Blooms Taxonomy Domain', 'Classification of the Competency Framework Item using Bloom''s Taxonomy Domains. ', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11875', '7', '11875')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000876', 'Competency Framework Item Multiple Intelligence', 'Learning Standard Item Multiple Intelligence', 'Classification of the Competency Framework Item using intelligences defined for Howard Earl Gardner''s Theory of Multiple Intelligences.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11876', '7', '11876')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000877', 'Competency Set Completion Criteria', NULL, 'The criteria for the set of competencies that represent completion or partial completion of a unit, course, program, degree, certification, or other achievement/award. Specifies whether completion requires achievement of all items in the set or some number of items.', NULL, '1', 'The criteria may be ‘all’ competencies in the set or ‘at-least’ # of competencies. Sets may be nested, e.g. all in subset A and 3 of 5 from subset B.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11877', '7', '11877')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000878', 'Competency Set Completion Criteria Threshold', NULL, 'The minimum number of competencies in the set that must be achieved for completion or partial completion of a unit, course, program, degree, certification, or other achievement/award.', 'Integer - greater than or equal to 0', '0', 'Used to define the completion criteria when Competency Set Completion Criteria is "At Least".  Not used when Competency Set Completion Criteria is "All".', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11878', '7', '11878')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000879', 'Learning Resource Competency Alignment Type', NULL, 'The alignment relationship between the resource and the competency.', NULL, '1', 'A community of SEAs have agreed to use a limited set of Learning Resource Competency Alignment Type options when tagging learning resources in shared resource repositories. Those options are assesses, teaches, and requires.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11879', '7', '11879')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000880', 'Competency Framework Language', 'Learning Standard Document Language', 'The default language of the text used for the content in the competency framework.', NULL, '1', 'The CEDS ISO 639-2 Language Code option set comes from the &lt;a href="http://www.loc.gov/standards/iso639-2/langhome.html"&gt;ISO 639-2 standard&lt;/a&gt;, the character encoding in ISO 8859-1 download.  Discontinued codes from the ISO standard are not included in the CEDS list.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11880', '7', '11880')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000881', 'Competency Framework Item Language', 'Learning Standard Item Language', 'The default language of the text used for the content in the competency framework item statement.', NULL, '1', 'The CEDS ISO 639-2 Language Code option set comes from the &lt;a href="http://www.loc.gov/standards/iso639-2/langhome.html"&gt;ISO 639-2 standard&lt;/a&gt;, the character encoding in ISO 8859-1 download.  Discontinued codes from the ISO standard are not included in the CEDS list.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11881', '7', '11881')
