INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000889', 'Assessment Registration Assignor Identifier', NULL, 'The unique identifier of the person who assigned the assessment to the learner.', 'Alphanumeric - 40 characters maximum', '0', 'For example, the unique identifier of a classroom teacher or school principal.&lt;BR/&gt;&lt;BR/&gt;CEDS "Identifier" elements reflect the intent of the XSD:Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;BR/&gt;&lt;BR/&gt;An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11889', '7', '11889')
