INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000892', 'Credential Category Type', NULL, 'The category of achievement attributed to the learner.', 'Alphanumeric - 60 characters maximum', '0', 'Categories could include "Competency Mastered", "Competency Retained", "Course Completed", "Level Completed", "Certificate Earned", "Diploma Earned", "License Earned", "License Endorsement Earned", "Participation", "Academic Honor", "Non-Academic Honor", etc. (This element supports an emerging use case, therefore a complete set of options are not known.  Future CEDS versions may define an Achievement Type element when a fixed option set can be compiled.)  Note: The Achievement entity is most valuable when linked to a specific competency set that defined the learning standards related to the achievement.(SEE "Achievement Category System")', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11892', '7', '11892')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
