VALUES ('000901', 'Credential Evidence Statement', NULL, 'A statement or reference describing the evidence that the learner met the criteria for attainment  of the achievement.', 'Alphanumeric - 300 characters maximum', '0', 'A narrative that may connect multiple pieces of evidence OR an IRI or document describing the work that the recipient did to earn the achievement. This can be a page that links out to other pages if linking directly to the work is infeasible. May be used in an array of multiple values.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11901', '7', '11901')
