VALUES ('000904', 'Assessment Item Possible Response Feedback Message', NULL, 'A message provided to the person being assessed after giving a response that matches the possible response.', 'Alphanumeric - 300 characters maximum', '0', 'This may be a message of affirmation for a correct answer or descriptive feedback for an incorrect answer.  For example, if the item asked the question what is 2 times 3 and the learner answered 5, the Feedback Message might be "Try multiplication instead of addition."', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11904', '7', '11904')
