INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000914', 'Learning Resource Subject Code', NULL, 'The code used to identify the organization of subject matter and related learning experiences addressed by the learning resource.', 'Alphanumeric - 30 characters maximum', '0', 'A promising practice is to use a URL as the Learning Resource Subject Code, that resolves to a web page describing a term in a subject taxonomy.  For example, for "Mathematics", the URL http://id.loc.gov/authorities/classification/BH301.M35.html points to the Library of Congress classification for "Mathematics".  For K12 curriculum "SCED" - School Courses for the Exchange of Data (SCED) may be used, e.g. https://ceds.ed.gov/ScedCourseCodes.aspx#02031 is "Mathematics (grade 1)"', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11914', '7', '11914')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000915', 'Learning Resource Subject Code System', NULL, 'The system that is used to identify the organization of subject matter and related learning experiences addressed by the learning resource.', 'Alphanumeric - 30 characters maximum', '0', 'This may be a URL to a web page describing the subject code system or a name or abbreviation for the system if no authoritative web page exists.  When the associated learning resource Subject Code is a URL, that URL usually provides enough context so that the "Subject Code System" need not be specified.  However, this may be the URL to a page describing the classification system and/or the entry point to the web hosted classification system.  E.g. for the Library of Congress Classification System use: http://id.loc.gov/authorities/classification.html', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11915', '7', '11915')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
