INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000919', 'Learning Resource Language', NULL, 'The primary language of the resource.', NULL, '1', 'The CEDS ISO 639-2 Language Code option set comes from the &lt;a href="http://www.loc.gov/standards/iso639-2/langhome.html"&gt;ISO 639-2 standard&lt;/a&gt;, the character encoding in ISO 8859-1 download.  Discontinued codes from the ISO standard are not included in the CEDS list.&lt;BR/&gt;Note: For accessible resources LRMI uses language codes from the IETF BCP 47 standard which also refers to ISO 639. (Equivalent of the AfA languageOfAdaptation property.)', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11920', '7', '11920')
