VALUES ('000954', 'Assessment Item Response Scaffolding Item Flag', NULL, 'Indicates that the response is to a scaffolding problem rather than the main/assigned problem.  A scaffolding item is a follow-up formative assessment item used to assess prerequisite or component skills, presented immediately after a learner gives an incorrect answer on the previous item.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11955', '7', '11955')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000955', 'Assessment Item Response Hint Count', NULL, 'The total number of hints presented as the learner responded to a formative assessment item.  This may include hints requested by the learner or hints automatically presented such as in an online tutoring system. Presentation of a scaffolding item is a separate response record and not counted as a hint.', 'Integer - greater than or equal to 0', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11956', '7', '11956')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000956', 'Assessment Item Response Hint Included Answer', NULL, 'Indicates that one of the hints presented included the correct answer.', NULL, '1', 'A typical scenario for an online tutoring application may present a series of hints for a formative assessment item with the last hint being the correct answer.  The learner must enter the correct answer before continuing.  This data element is a flag that the learner was presented with the "bottom hint", which is the correct answer.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11957', '7', '11957')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000957', 'Assessment Item Response First Attempt Duration', NULL, 'The amount of time in seconds or milliseconds that a person took to give an initial response, a first attempt to answer a formative assessment item.', 'HH:MM:SS or HH:MM:SS.sss', '0', 'Formative assessments often allow learners to make multiple attempts until a correct or acceptable answer is given.  In such cases it is valuable to know both the time it took for the initial response and the total time spent responding to the problem.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11958', '7', '11958')
