VALUES ('000967', 'Assessment Administration Assessment Family', NULL, 'The title of the assessment family to be administered.', 'Alphanumeric - 60 characters maximum', '0', 'A typical scenario for an assessment administration is a state-wide administration of an accountability test.  For example, in Florida "Florida Comprehensive Assessment Test".', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11968', '7', '11968')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000968', 'Assessment Session Security Issue', NULL, 'The description of a security issue, if any, discovered for an administration of an assessment, such as suspected cheating by a student or a teacher changing answers after a student takes the test.', 'Alphanumeric - 300 characters maximum', '0', 'For example: Suspected plagiarism ; Computer left test window ; Excessive response time ; Proctor suspected copying ; Student identity not confirmed ; No proctor present ; Student carried wireless mobile device during test ; Student terminated test early and restarted ; Excessive erasures on test form ; Response pattern identical to another student''s', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11969', '7', '11969')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000969', 'Assessment Item Response Security Issue', NULL, 'The description of security issue, if any, related to a learner''s response to an assessment item.', 'Alphanumeric - 300 characters maximum', '0', 'For example: Suspected plagiarism ; Computer left test window ; Excessive response time ; Proctor suspected copying ; Student identity not confirmed ; No proctor present ; Student carried wireless mobile device during test ; Student terminated test early and restarted ; Excessive erasures on test form ; Response pattern identical to another student''s', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11970', '7', '11970')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000970', 'Assessment Result Date Updated', NULL, 'The most recent date that the result was calculated/updated.  The value should be the same as Assessment Result Date Created if the subtest has only been scored once, but may be different if the score was recalculated with a different result.', 'YYYY-MM-DD', '0', 'This flag is to handle cases when a subtest result is originally scored using incorrect parameters and then rescored, such as if the grade level attributed to the student was originally encoded incorrectly and later corrected.  An operational system may also capture the history of if rescored more than once.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11971', '7', '11971')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000971', 'Assessment Result Date Created', NULL, 'The date on which the assessment result was generated.', 'YYYY-MM-DD', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11972', '7', '11972')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000972', 'Teacher Student Data Link Exclusion Flag', NULL, 'Indicates that the student is excluded from calculation of value-added or growth attribution calculations used for teacher evaluation.', NULL, '1', 'The context for this element is the intersection of a teacher assignment to a Class/Section and a student enrollment to a Class/Section.  It may be represented in a data model as a separate entity such as Teacher Student Data Link Exclusion.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11973', '7', '11973')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000973', 'Demographic Race Two or More Races', NULL, 'A person having origins in any of more than one of the racial groups.', NULL, '1', 'To support backward compatibility for systems that cannot derive this, i.e. systems that use a single race/ethnicity element rather than separate flags that can indicate one or more ethnicities.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11974', '7', '11974')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000974', 'Course Section Enrollment Status Start Date', NULL, 'The date on which the enrollment status began related to a student enrolled in an instance of a course.', 'YYYY-MM-DD', '0', 'Enrollment statuses may overlap, for example at one point in time a student may be both pre-registered and wait listed for enrollment in a course, the start dates may be different and the end dates may be the same as the start date for "enrolled" status when the student moves off the wait list.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11975', '7', '11975')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000975', 'Course Section Enrollment Status End Date', NULL, 'The date on which the enrollment status ended related to a student enrolled in an instance of a course.', 'YYYY-MM-DD', '0', 'Enrollment statuses may overlap, for example at one point in time a student may be both pre-registered and wait listed for enrollment in a course, the start dates may be different and the end dates may be the same as the start date for "enrolled" status when the student moves off the wait list.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11976', '7', '11976')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000976', 'Course Section Enrollment Status Type', NULL, 'The status related to a student enrollment in an instance of a course.', NULL, '1', 'Enrollment statuses may overlap, for example at one point in time a student may be both pre-registered and wait listed for enrollment in a course, the start dates may be different and the end dates may be the same as the start date for "enrolled" status when the student moves off the wait list.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11977', '7', '11977')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000977', 'Assessment Administration Name', NULL, 'The name given to an assessment event.', 'Alphanumeric - 30 characters maximum', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11978', '7', '11978')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000978', 'Course Section Identifier', NULL, 'A unique number or alphanumeric code assigned by an institution, school, school system, state, or other agency or entity for a particular course-section.', 'Alphanumeric - 40 characters maximum', '0', 'CEDS "Identifier" elements reflect the intent of the XSD:Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11979', '7', '11979')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000979', 'Assessment Form Section Sequence Number', NULL, 'The position of the assessment section presented in the sequence of sections within an assessment form.', 'Numeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11980', '7', '11980')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000980', 'Assessment Form Section GUID', NULL, 'The globally unique identifier of an Assessment Form Section using a RFC 4122 compliant hexadecimal string.', 'Alphanumeric - 40 characters maximum', '0', 'CEDS "GUID" elements are defined as RFC 4122 compliant 32-character hexadecimal strings (36 characters with dashes). For example, 21EC2020-3AEA-1069-A2DD-08002B30309D. &lt;br/&gt;&lt;br/&gt;Values MAY be encoded using a hash function such as HMAC-MD5 or HMAC-SHA1, resulting in a string up to 40 characters.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11981', '7', '11981')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000981', 'Assessment GUID', NULL, 'The globally unique identifier of an Assessment using a RFC 4122 compliant hexadecimal string.', 'Alphanumeric - 40 characters maximum', '0', 'CEDS "GUID" elements are defined as RFC 4122 compliant 32-character hexadecimal strings (36 characters with dashes). For example, 21EC2020-3AEA-1069-A2DD-08002B30309D. &lt;br/&gt;&lt;br/&gt;Values MAY be encoded using a hash function such as HMAC-MD5 or HMAC-SHA1, resulting in a string up to 40 characters.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11982', '7', '11982')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000982', 'Accreditation Agency', NULL, 'The agency that accredited a program.', NULL, '1', 'Organization Name may be used with Organization Type=''Accrediting Organization'' when Accreditation Agency is set to ''Other Accreditation Agency.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11983', '7', '11983')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000983', 'Administrative Policy Type', NULL, 'A type of administrative policy used by a program.', NULL, '1', 'More than one Administrative Policy Type may apply.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11984', '7', '11984')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000984', 'Facility Licensing Status', NULL, 'The status of the facility license.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11985', '7', '11985')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000985', 'Session Start Time', NULL, 'The hour, minute and second on which a session begins.', 'HH:MM:SS', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11986', '7', '11986')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000986', 'Session End Time', NULL, 'The hour, minute and second on which a session ends.', 'HH:MM:SS', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11988', '7', '11988')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000987', 'Employed While Enrolled', NULL, 'An individual who is a paid employee or works in his or her own business, profession, or farm, as reported through the State Unemployment Insurance Wage Report, FEDES, or WRIS, and at the same time is enrolled in secondary, postsecondary, or adult education or workforce programs.', NULL, '1', 'Individual-level data obtained by matching records with wage records, FEDES, or WRIS. The State Education Agency defines the time period for this collection around an exit period and a corresponding period for employment and earnings data to be obtained. The option set includes "Yes" for employment found via one of the resources listed in the source element. These sources won''t tell you anything further about employment or unemployment, only that a record was "not found" or "not matched" thus "unknown."', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11989', '7', '11989')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000988', 'Employed After Exit', NULL, 'An individual who is a paid employee or works in his or her own business, profession, or farm, as reported through the State Unemployment Insurance Wage Report, FEDES, or WRIS, after exiting secondary, postsecondary, or adult education or workforce programs.', NULL, '1', 'Individual-level data obtained by matching records with wage records, FEDES, or WRIS. The State Education Agency defines the time period for this collection around an exit period and a corresponding period for employment and earnings data to be obtained. The option set includes "Yes" for employment found via one of the resources listed in the source element. These sources will provide information about most of the types of jobs that students or former students will  become employed in but not all.  For that reason when a record is "not found" or "not matched" their employment status is "unknown" for the targeted time base.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11990', '7', '11990')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000989', 'Quarterly Earnings', NULL, 'The quarterly amount paid to individuals found employed during the reference period.', 'Numeric - up to 2 digits after decimal place', '0', 'Workforce Notes: Quarterly earnings are the sum of all the reported earnings for each individual for all jobs held during the reference quarter. "Reference" quarter is the period of employment defined by the agency for its purposes either for students who are enrolled or after they exit. The amount is expressed as a numeric dollar amount. Note that it may be desirable to collect these data over time, in a longitudinal sense, to measure things related to persistence and growth in employment.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11991', '7', '11991')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000990', 'Employment Location', NULL, 'The state or other location in which an individual is found employed.', NULL, '1', 'Workforce Notes: The most commonly available indication of where employment is located is at the state level. While federal data resources provide indicators outside of the United States, these resources will not represent the majority of the students found employed, which will be based on state UI Wage Data. There may, in some instances, be multiple states where employment is found. Note that it may be desirable to collect these data over time, in a longitudinal sense, to measure things related to persistence, change, and growth in employment.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11992', '7', '11992')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000991', 'Person Employed in Multiple Jobs Count', NULL, 'The number of jobs held by a person during the reference period.', 'Integer - greater than or equal to 0', '0', 'Workforce Notes: The data sources represent employment during a three month period. Students found employed may have multiple jobs during a reference period with no indication of their sequence. The option set provides a set of numeric ranges for these instances. Many states report these numbers, some as indications of employment stability. Note that it may be desirable to collect these data over time, in a longitudinal sense, to measure things related to persistence, change, and growth in employment.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11993', '7', '11993')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000992', 'Employment Record Reference Period Start Date', NULL, 'The year, month, and day of the first day of the employment record reference period.', 'YYYY-MM-DD', '0', 'The reference quarter is the 13-week period around which employment and earnings data are collected. For unemployment insurance purposes, quarters are defined by 13-week periods. In most state cases, a reference quarter is defined to coincide with an enrollment period (e.g., a term or semester) or as a certain number of quarters after exiting a program, such as "3d quarter after exit." In some cases, states have defined the reference quarter to represent a period where employment and earnings data are collected for all of a previous year''s exits and graduates. This is often the October- December quarter. Ultimately, the most value to be gained from the use of employment and earnings data is when data are collected continuously, both in a longitudinal sense for defined cohorts of students, as well as for an "annual set" of students.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11994', '7', '11994')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000993', 'Employment Record Reference Period End Date', NULL, 'The year, month, and day of the last day of the employment record reference period.', 'YYYY-MM-DD', '0', 'The reference quarter is the 13-week period around which employment and earnings data are collected. For unemployment insurance purposes, quarters are defined by 13-week periods. In most state cases, a reference quarter is defined to coincide with an enrollment period (e.g., a term or semester) or as a certain number of quarters after exiting a program, such as "3d quarter after exit." In some cases, states have defined the reference quarter to represent a period where employment and earnings data are collected for all of a previous year''s exits and graduates. This is often the October- December quarter. Ultimately, the most value to be gained from the use of employment and earnings data is when data are collected continuously, both in a longitudinal sense for defined cohorts of students, as well as for an "annual set" of students.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11995', '7', '11995')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000994', 'Employment Record Administrative Data Source', NULL, 'Administrative data source of information used to collect employment and earnings-related data.', NULL, '1', 'For over 25 years, states have relied upon administrative data sources to document the employment and earnings of students and former students. The sources listed are complementary, rather than alternatives. That is, State UI records only include information for employees within a state''s boundaries. The WRIS II system can provide employment data for other states (from their UI wage record systems). State UI records do not include information about federal or postal service employment, nor do they contain information about military enlistments. FEDES provides access to that information. Ideally, an entity will use UI, WRIS (other state UI), and FEDES together.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=11996', '7', '11996')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000997', 'Workforce Program Type', NULL, 'The type of workforce and employment development program that an individual is participating in.', NULL, '1', 'A reference period for identifying program participation during or after enrollment in secondary education, postsecondary education, or adult education will have to be defined by the agency in collaboration with other agency partners.  At this point this element is intended only to indicate program participation and does not delve into programmatic details, persistence, or completion.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12000', '7', '12000')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000998', 'Workforce Program Participation Start Date', NULL, 'The year, month, and day of the first day of the reference period during which data are matched between education and workforce data sources.', 'YYYY-MM-DD', '0', 'Agencies define the time period for this collection around an enrollment period or exit date with a to-be defined lag period following an exit event. Enrollment periods are defined in CEDS for K12 and postsecondary students. The term "exit" includes leaving education for any reason including dropping out or graduating with or without a credential. Exiting conditions are defined in CEDS for K12 and postsecondary students.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12001', '7', '12001')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('000999', 'Workforce Program Participation End Date', NULL, 'The year, month, and day of the last day of the reference period during which data are matched between education and workforce data sources.', 'YYYY-MM-DD', '0', 'Agencies define the time period for this collection around an enrollment period or exit date with a to-be defined lag period following an exit event. Enrollment periods are defined in CEDS for K12 and postsecondary students. The term "exit" includes leaving education for any reason including dropping out or graduating with or without a credential. Exiting conditions are defined in CEDS for K12 and postsecondary students.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12002', '7', '12002')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001000', 'Assessment Early Learning Developmental Domain', NULL, 'Developmental domains related to early learning and used for assessing a child''s kindergarten readiness.', NULL, '1', 'Used by states in reporting Kindergarten Entry Assessment (KEA) results as defined for some federal grant programs.&lt;BR/&gt;&lt;BR/&gt;For each domain used by the state, the state would provide:&lt;BR/&gt;- The total number of children who participated in the KEA for each domain&lt;BR/&gt;- The number of children who participated in the KEA for each domain AND was at or above what the state defines as “ready” for kindergarten for that domain.&lt;BR/&gt;&lt;BR/&gt;The counts may be calculated using unit-level data defined for Assessment Subtest (scoring method and what is being measured, e.g. the Domain), related Assessment Performance Levels (e.g. "Ready"), related to each student Assessment Result.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12003', '7', '12003')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001001', 'Special Needs Policy', NULL, 'Program ensures that policies are in place for  Individualized Education Programs (IEPs) or Individual Family Service Plans (IFSPs) to meet the child''s unique needs.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12004', '7', '12004')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001002', 'Learning Resource Educational Use', NULL, 'The purpose of the work in the context of education.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12005', '7', '12005')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001003', 'Assessment Participant Session Delivery Device Details', NULL, 'The details about the device or platform by with which the assessment was delivered to the learner.', 'Alphanumeric - 300 characters maximum', '0', 'For example web browser version and screen resolution.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12006', '7', '12006')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001004', 'Assessment Personal Needs Profile Assigned Support', NULL, 'Defines whether or not the individual needs the kind of support defined by the entity.', NULL, '1', 'This flag may apply to any need within the Assessment Personal Need Profile.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12007', '7', '12007')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001005', 'Assessment Personal Needs Profile Activate By Default', NULL, 'Determines if the alternative accessible content is rendered as the default content for the learner.', NULL, '1', 'This flag may apply to any need within the Assessment Personal Need Profile.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12008', '7', '12008')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001006', 'Assessment Provider', NULL, 'Identifies the provider or publisher of the assessment.', 'Alphanumeric - 30 characters maximum', '0', 'AIF property', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12009', '7', '12009')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001007', 'Assessment Result Preliminary Indicator', NULL, 'If this score is preliminary, then this attribute value should be set.  Preliminary scores may be provided for early use by the assessment program or user while final scoring is occurring.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12010', '7', '12010')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001008', 'Diagnostic Statement Source', NULL, 'Identifies the source of the Diagnostic Statement based on a scored/evaluated portion of an assessment.', 'Alphanumeric - 300 characters maximum', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12011', '7', '12011')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001009', 'Assessment Result Number of Responses', NULL, 'The number of responses that are included with the Student Score Set. Responses are those items that were attempted (partially or fully answered) by the student and not necessarily the number of items in the assessment (which can be determined from the assessment object).', 'Integer - greater than or equal to 0', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12012', '7', '12012')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001010', 'Assessment Form Subtest Item Weight Correct', NULL, 'A weighting factor for how the item score is used to compute a sub-test score when the item is correct or partially correct. Item weight of 1 indicates the full item score is used. A weight of .5 would indicate the item only contributes one half of the item score to the subtest. A weight of 0 indicates the item does not affect the sub test score.', 'Numeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12013', '7', '12013')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001012', 'Assessment Form Subtest Item Weight Incorrect', NULL, 'A weighting factor for how the item score is used to compute a sub-test score when the item is attempted and incorrect. Item weight should be a negative value if the item subtracts from the score if missed.', 'Numeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12014', '7', '12014')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
