INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001088', 'NAEP Mathematical Complexity Level', NULL, 'Complexity levels defined by the National Assessment of Educational Progress (NAEP 2005a Framework).', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12072', '7', '12072')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001089', 'Assessment Language', NULL, 'The language in which the assessment form is designed to be delivered.', NULL, '1', 'The CEDS ISO 639-2 Language Code option set comes from the &lt;a href="http://www.loc.gov/standards/iso639-2/langhome.html"&gt;ISO 639-2 standard&lt;/a&gt;, the character encoding in ISO 8859-1 download.  Discontinued codes from the ISO standard are not included in the CEDS list.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12073', '7', '12073')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001091', 'Assessment Subtest Published Date', NULL, 'The date on which the Subtest was published.', 'YYYY-MM-DD', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12075', '7', '12075')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001092', 'Assessment Result Descriptive Feedback Source', NULL, 'Identifies the source of the descriptive feedback that was given to a learner based on a scored/evaluated portion of an assessment. May indicate if this is teacher, scorer, or system generated feedback. Values for this attribute would be determined by the assessment program.', 'Alphanumeric - 60 characters maximum', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12076', '7', '12076')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001093', 'Assessment Session Special Event Description', NULL, 'Describes special events that occur before during or after the assessment session that may impact use of results according to rules related to the Assessment Registration Testing Indicator.', 'Alphanumeric - 60 characters maximum', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12077', '7', '12077')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001094', 'Competency Framework Item Parent URL', 'Learning Standard Item Parent URL', 'A network-resolvable Uniform Resource Locator (URL) pointing to the authoritative reference for the hierarchal parent of the competency framework item.', 'Alphanumeric - 512 characters maximum', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12078', '7', '12078')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001102', 'Assessment Item Body Custom Interaction XML', NULL, 'The custom interaction provides an opportunity for extensibility of this specification to include support for interactions not currently documented.  The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12079', '7', '12079')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001103', 'Assessment Item Body Drawing Interaction XML', NULL, 'The drawing interaction allows the candidate to use a common set of drawing tools to modify a given graphical image (the canvas). It must be bound to a response variable with base-type file and single cardinality. The result is a file in the same format as the original image. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12080', '7', '12080')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001104', 'Assessment Item Body Gap Match Interaction XML', NULL, 'A gap match interaction contains a number gaps that the candidate can fill from an associated set of choices. The candidate must be able to review the content with the gaps filled in context, as indicated by their choices. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12081', '7', '12081')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001105', 'Assessment Item Body Match Interaction XML', NULL, 'A match interaction presents candidates with two sets of choices and allows them to create associates between pairs of choices in the two sets, but not between pairs of choices in the same set. Further restrictions can still be placed on the allowable associations using the matchMax attribute of the choices. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12082', '7', '12082')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001106', 'Assessment Item Body Graphic Gap Match Interaction XML', NULL, 'A graphic gap-match interaction is a graphical interaction with a set of gaps that are defined as areas (hotspots) of the graphic image and an additional set of gap choices that are defined outside the image. The candidate must associate the gap choices with the gaps in the image and be able to review the image with the gaps filled in context, as indicated by their choices. Care should be taken when designing these interactions to ensure that the gaps in the image are a suitable size to receive the required gap choices. It must be clear to the candidate which hotspot each choice has been associated with. When associated, choices must appear wholly inside the gaps if at all possible and, where overlaps are required, should not hide each other completely. If the candidate indicates the association by positioning the choice over the gap (e.g., drag and drop) the system should ''snap'' it to the nearest position that satisfies these requirements. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12083', '7', '12083')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001107', 'Assessment Item Body Hot Spot Interaction XML', NULL, 'A hotspot interaction is a graphical interaction with a corresponding set of choices that are defined as areas of the graphic image. The candidate''s task is to select one or more of the areas (hotspots). The hotspot interaction should only be used when the spatial relationship of the choices with respect to each other (as represented by the graphic image) is important to the needs of the item. Otherwise, choiceInteraction should be used instead with separate material for each option. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12084', '7', '12084')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001108', 'Assessment Item Body Graphic Order Interaction XML', NULL, 'A graphic order interaction is a graphic interaction with a corresponding set of choices that are defined as areas of the graphic image. The candidate''s task is to impose an ordering on the areas (hotspots). The order hotspot interaction should only be used when the spatial relationship of the choices with respect to each other (as represented by the graphic image) is important to the needs of the item. Otherwise, orderInteraction should be used instead with separate material for each option. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12085', '7', '12085')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001109', 'Assessment Item Body Select Point Interaction XML', NULL, 'Like hotspotInteraction, a select point interaction is a graphic interaction. The candidate''s task is to select one or more points. The associated response may have an areaMapping that scores the response on the basis of comparing it against predefined areas but the delivery engine must not indicate these areas of the image. Only the actual point(s) selected by the candidate shall be indicated. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12087', '7', '12087')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001110', 'Assessment Item Body Select Point Interaction', NULL, 'A graphic associate interaction is a graphic interaction with a corresponding set of choices that are defined as areas of the graphic image. The candidate''s task is to associate the areas (hotspots) with each other. The graphic associate interaction should only be used when the graphical relationship of the choices with respect to each other (as represented by the graphic image) is important to the needs of the item. Otherwise, associateInteraction should be used instead with separate Material for each option. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12088', '7', '12088')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001111', 'Assessment Item Body Slider Interaction XML', NULL, 'The slider interaction presents the candidate with a control for selecting a numerical value between a lower and upper bound. It must be bound to a response variable with single cardinality with a base-type of either integer or float. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12089', '7', '12089')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001112', 'Assessment Item Body Choice Interaction XML', NULL, 'The choice interaction presents a set of choices to the candidate. The candidate''s task is to select one or more of the choices, up to a maximum of maxChoices. The interaction is always initialized with no choices selected. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12090', '7', '12090')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001114', 'Assessment Item Body Inline Choice Interaction XML', NULL, 'A inline choice is an inline interaction that presents the user with a set of choices, each of which is a simple piece of text. The candidate''s task is to select one of the choices. Unlike the Choice Interaction, the delivery engine must allow the candidate to review their choice within the context of the surrounding text.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12091', '7', '12091')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001115', 'Assessment Item Body Media Interaction XML', NULL, 'The media interaction allows more control over the way the candidate interacts with a time-based media object and allows the number of times the media object was experienced to be reported in the value of the associated response variable, which must be of base-type integer and single cardinality. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12092', '7', '12092')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001116', 'Assessment Item Body Hottext Interaction XML', NULL, 'The hottext interaction presents a set of choices to the candidate represented as selectable runs of text embedded within a surrounding context, such as a simple passage of text. Like choiceInteraction, the candidate''s task is to select one or more of the choices, up to a maximum of maxChoices. The interaction is initialized from the defaultValue of the associated response variable, a NULL value indicating that no choices are selected (the usual case). The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12093', '7', '12093')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001117', 'Assessment Item Body Order Interaction XML', NULL, 'In an order interaction the candidate''s task is to reorder the choices, the order in which the choices are displayed initially is significant. By default the candidate''s task is to order all of the choices but a subset of the choices can be requested using the maxChoices and minChoices attributes. When specified the candidate must select a subset of the choices and impose an ordering on them. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12094', '7', '12094')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001118', 'Assessment Item Body Position Object Interaction XML', NULL, 'The position object interaction consists of a single image which must be positioned on another graphic image (the stage) by the candidate. Like selectPointInteraction, the associated response may have an areaMapping that scores the response on the basis of comparing it against predefined areas but the delivery engine must not indicate these areas of the stage. Only the actual position(s) selected by the candidate shall be indicated. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12095', '7', '12095')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001119', 'Assessment Item Body Text Entry Interaction XML', NULL, 'A textEntry interaction obtains a simple piece of text from the candidate. Like inlineChoiceInteraction, the delivery engine must allow the candidate to review their choice within the context of the surrounding text. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12096', '7', '12096')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001120', 'Assessment Item Body Extended Text Interaction XML', NULL, 'An extended text interaction allows the candidate to enter an extended amount of text. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12097', '7', '12097')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001121', 'Assessment Item Body End Attempt Interaction XML', NULL, 'The end attempt interaction is a special type of interaction which allows item authors to provide the candidate with control over the way in which the candidate terminates an attempt. The candidate can use the interaction to terminate the attempt (triggering response processing) immediately, typically to request a hint. It must be bound to a response variable with base-type boolean and single cardinality. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12098', '7', '12098')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001122', 'NAEP Aspects of Reading', NULL, 'Aspects of reading defined by the National Assessment of Educational Progress (NAEP 2005b Framework).', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12166', '7', '12166')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001123', 'Assessment Item Body Associate Interaction XML', NULL, 'An associate interaction presents candidates with a number of choices and allows them to create associations between them. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12100', '7', '12100')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001127', 'Assessment Need Type', NULL, 'A type of need identified for a learner as part of an assessment need profile.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12101', '7', '12101')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001130', 'Assessment Participant Session Security Issue', NULL, 'Describes an issue related to the security of a testing instrument identified during a specific instance of delivering an assessment to a specific person during a specific time period.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12102', '7', '12102')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001131', 'Assessment Item APIP Response Processing Template URL', NULL, 'These templates are described using the processing language defined in IMS Global APIP specification and are distributed (in XML form) along with it. Delivery engines that support generalized response processing do not need to implement special mechanisms to support them as a template file can be parsed directly while processing the assessment item that refers to it. This element provides the URL for the template.', 'Alphanumeric - 512 characters maximum', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12103', '7', '12103')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001132', 'Assessment Item APIP Response Processing XML', NULL, 'Response processing is the process by which the Delivery Engine assigns outcomes based on the learner''s responses. The outcomes may be used to provide feedback to the learner Feedback is either provided immediately following the end of the learner''s attempt or it is provided at some later time, perhaps as part of a summary report on the item session. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12104', '7', '12104')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001133', 'Assessment Item APIP Response Declaration XML', NULL, 'Response declarations state what the response variables include.  The response declaration may assign an optional correct response. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12105', '7', '12105')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001134', 'Assessment Item APIP Outcome Declaration XML', NULL, 'Outcome variables are declared by outcome declarations. Their value is set either from a default given in the declaration itself or by a responseRule during response processing.  The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12106', '7', '12106')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001135', 'Assessment Item APIP Template Declaration XML', NULL, 'Template declarations declare item variables that are to be used specifically for the purposes of cloning items. They can have their value set only during template processing. They are referred to within the item body in order to individualize the clone and possibly also within the response Processing rules if the cloning process affects the way the item is scored.  The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12107', '7', '12107')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001136', 'Assessment Item APIP Template Processing XML', NULL, 'Template processing consists of one or more template rules that are followed by the cloning engine or delivery system in order to assign values to the template variables. Template processing is identical in form to responseProcessing except that the purpose is to assign values to template variables, not outcome variables. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12108', '7', '12108')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001137', 'Assessment Item APIP Modal Feedback XML', NULL, 'Modal feedback is shown to the candidate directly following response processing. The value of an outcome variable is used in conjunction with the showHide and identifier attributes to determine whether or not the feedback is shown in a similar way to feedbackElement. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12109', '7', '12109')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001138', 'Assessment Item APIP Item Body XML', NULL, 'The item body contains the text, graphics, media objects, and interactions that describe the item''s content and information about how it is structured. The body is presented by combining it with stylesheet information, either explicitly or implicitly using the default style rules of the delivery or authoring system. This element contains the appropriate XML from the IMS Global APIP Specification defining the various item body interactions.', 'Alphanumeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12110', '7', '12110')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001139', 'Assessment Item Adaptive Indicator', NULL, 'This indicator determines whether an assessment item is an adaptive item.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12111', '7', '12111')
