VALUES ('001162', 'Assessment Registration Test Attempt Identifier', NULL, 'A unique identifier for the test attempt assigned by the delivery system.', 'Alphanumeric - 40 characters maximum', '0', 'For paper-based tests this is typically a batch/stack/serial number and for online tests it is likely a unique internal identifier. Used to locate the original attempt.&lt;br/&gt;&lt;br/&gt;CEDS "Identifier" elements reflect the intent of the XSD:Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12119', '7', '12119')
