VALUES ('001193', 'Assessment Form Section Sealed', NULL, 'Indicates this section is sealed, meaning the test taker cannot enter the section until authorized by the proctor.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12144', '7', '12144')
