VALUES ('001194', 'Assessment Form Section Reentry', NULL, 'Indicates that this section can be re-entered, meaning the test taker can return to this section after they have left the section. A common example of this is a two section test where one section does not allow the use of a calculator and the other does. Typically the test taker cannot return to the non-calculator section after they have used a calculator.', NULL, '1', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12145', '7', '12145')
