VALUES ('001195', 'Assessment Asset Version', NULL, 'A version number or label defined by the publisher.', 'Alphanumeric - 30 characters maximum', '0', 'In some use cases a date, such as Learning Resource Date Created may be used as an alternative to a version number.  Each use case may adopt different rules depending on the application requirements for maintenance of current version only or the multiple objects/records representing the complete version history.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12146', '7', '12146')
