VALUES ('001196', 'Assessment Asset Type', NULL, 'Specifies a predominant type of assessment asset represented by the Learning Resource.  Assessment assets represent any content used to compose an assessment item, is referenced by an item but not part of the item content itself, or is content that is included as part of a section within an assessment form. Assets can be static content such as art work or dynamic assets such as calculators.', NULL, '1', 'The standard option set may be extended based on local and implementation-specific requirements.  Commonly used options may be submitted for inclusion in future versions of CEDS.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12147', '7', '12147')
