VALUES ('001251', 'Assessment Item Response Theory Parameter A', NULL, 'The Item Response Theory value representing the discrimination of the item. The a parameter is found by taking the slope of the line tangent to the item characteristic curve at the inflection point, B. The parameter is the steepness of the curve at its steepest point.', 'Numeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12217', '7', '12217')
