VALUES ('001252', 'Assessment Item Response Theory Parameter B', NULL, 'The Item Response Theory value representing the difficulty of the item.   It is the Theta value for the location of the inflection point of the item characteristic curve.', 'Numeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12218', '7', '12218')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
