VALUES ('001254', 'Assessment Item Response Theory Parameter C', NULL, 'The Item Response Theory value for multiple choice items representing the guessing of the item. The c parameter is a lower asymptote. It is the low point of the curve as it moves to negative infinity on the horizontal axis. You can think of c as the probability that a chicken would get the item right.', 'Numeric', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12220', '7', '12220')
