VALUES ('001283', 'Allergy Type', NULL, 'Type of allergy condition attributed to a person as defined by the SNOWMED Clinical Terms(r) vocabulary.', NULL, '1', 'This material includes SNOMED Clinical Terms® (SNOMED CT®) which is used by permission of the International Health Terminology Standards Development Organisation (IHTSDO). All rights reserved. SNOMED CT®, was originally created by The College of American Pathologists. “SNOMED” and “SNOMED CT” are registered trademarks of the IHTSDO.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12249', '7', '12249')
