INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001287', 'Blended Learning Model Type', NULL, 'A type of formal education program in which a student learns at least in part through online learning, with some element of student control over time, place, path, and/or pace; at least in part in a supervised brick-and-mortar location away from home; and the modalities along each student’s learning path within a course or subject are connected to provide an integrated learning experience.', NULL, '1', 'This may be an attribute of a Course (as designed) or a Class Section (as delivered). It also may be attributed to a school, institution, or program for "whole-school" blended models.&lt;BR/&gt;&lt;BR/&gt;Options and definition adapted from: http://www.christenseninstitute.org/blended-learning-model-definitions/', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12253', '7', '12253')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001288', 'Career Cluster', NULL, 'The career cluster that defines the industry or occupational focus which may be associated with a career pathways program, plan of study, or course.', NULL, '1', 'Options from O*NET OnLine an application that was created for the general public to provide broad access to the O*NET database of occupational information. O*NET OnLine offers a variety of search options and occupational data, while My Next Move is a streamlined application for students and job seekers. Both applications were developed for the U.S. Department of Labor by the National Center for O*NET Development.  See onetonline.org for more information.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12254', '7', '12254')
