VALUES ('001342', 'Employed Prior to Enrollment', NULL, 'An individual who is a paid employee or works in his or her own business, profession, or farm, as reported through the State Unemployment Insurance Wage Report, FEDES, or WRIS, before enrolling in secondary, postsecondary, or adult education or workforce programs.', NULL, '1', 'Individual-level data obtained by matching records with wage records, FEDES, or WRIS. The State Education Agency defines the time period for this collection around an exit period and a corresponding period for employment and earnings data to be obtained. The option set includes "Yes" for employment found via one of the resources listed in the source element. These sources won''t tell you anything further about employment or unemployment, only that a record was "not found" or "not matched" thus “unknown."', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12309', '7', '12309')
