VALUES ('001349', 'Financial Account K12 Program Code', NULL, 'A program is a plan of activities and procedures designed to accomplish a predetermined objective or set of objectives.  The program classification provides the school district with a framework to classify instructional and other expenditures by program to determine cost.', NULL, '1', 'Based on codes specified in the NCES Handbook &lt;a href="http://nces.ed.gov/pubs2015/fin_acct/chapter6_2.asp"&gt;"Financial Accounting for Local and State School Systems: 2014 Edition"&lt;/a&gt;.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12316', '7', '12316')
