VALUES ('001352', 'Financial Aid Income Level', NULL, 'The income level of an individual that is used by an institution''s financial aid office to determine an individual''s Expected Family Contribution (EFC).  For dependent students this will include the parents'' adjusted gross income and the student''s adjusted gross income.  For independent students this will include the student''s adjusted gross income.', 'Numeric - up to 2 digits after decimal place', '0', NULL, 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12319', '7', '12319')
