VALUES ('001353', 'Financial Account K12 Balance Sheet Code', NULL, 'Balance sheet accounts and statement of net position accounts are used to track financial transactions for each fund. Such financial statements only report assets, deferred outflows of resources, liabilities, deferred inflows of resources, and equity accounts and are considered "snapshots" of how these accounts stand as of a certain point in time.', NULL, '1', 'Based on codes specified in the NCES Handbook &lt;a href="http://nces.ed.gov/pubs2015/fin_acct/chapter6_3.asp"&gt;"Financial Accounting for Local and State School Systems: 2014 Edition"&lt;/a&gt;.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12320', '7', '12320')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001354', 'Financial Expenditure K12 Function Code', NULL, 'The function describes the activity for which a service or material object is acquired. The functions of a school district are classified into five broad areas: instruction, support services, operation of noninstructional services, facilities acquisition and construction, and debt service. Functions are further classified into sub functions.', NULL, '1', 'Based on codes specified in the NCES Handbook &lt;a href="http://nces.ed.gov/pubs2015/fin_acct/chapter6_5.asp"&gt;"Financial Accounting for Local and State School Systems: 2014 Edition"&lt;/a&gt;.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12321', '7', '12321')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001355', 'Financial Expenditure K12 Object Code', NULL, 'This classification is used to describe the service or commodity obtained as the result of a specific expenditure.  Nine major object categories have codes ending in 00 and are further subdivided.', NULL, '1', 'Based on codes specified in the NCES Handbook &lt;a href="http://nces.ed.gov/pubs2015/fin_acct/chapter6_6.asp"&gt;"Financial Accounting for Local and State School Systems: 2014 Edition"&lt;/a&gt;.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12322', '7', '12322')
