VALUES ('001517', 'School Courses for the Exchange of Data Course Code', 'SCED Course Code', 'The five-digit SCED code. The first two-digits of the code represent the Course Subject Area and the next three digits identify the course number. These identifiers are fairly general but provide enough specificity to identify the course''s topic and to distinguish it from other courses in that subject area.', NULL, '1', 'See http://www.nces.ed.gov/programs/handbook/elementinfo.asp?elementid=14106.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12490', '7', '12490')
