VALUES ('001524', 'Competency Framework Item Previous Version Identifier', 'Learning Standard Item Previous Version Identifier', 'The unique identifier of the previous version of the Competency Framework Item if the statement was modified.', 'Alphanumeric - 40 characters maximum', '0', 'This element supports version histories at the statement level. If corrections have been made to individual items/statements that are not part of a new Learning Standard Document, the elements ''Learning Standard Item Previous Version Identifier'' and ''Learning Standard Item Current Version Indicator'' provide a reference to historical versions of the current statement. In such uses the ''Learning Standard Item Code'' could be the same for multiple versions of a statement and Learning Standard Item URL could resolve to the most current version of the statement.&lt;br/&gt;&lt;br/&gt;&lt;BR/&gt;CEDS "Identifier" elements reflect the intent of the XSD:Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces.&lt;br/&gt;&lt;br/&gt;&lt;BR/&gt;An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12498', '7', '12498')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001525', 'Competency Framework Item Current Version Indicator', 'Learning Standard Item Current Version Indicator', 'Indicates that this is the most current version of the Competency Framework Item.', NULL, '1', 'This element supports version histories at the statement level. If corrections have been made to individual items/statements that are not part of a new Learning Standard Document,  the elements ''Learning Standard Item Previous Version Identifier'' and ''Learning Standard Item Current Version Indicator'' provide a reference to historical versions of the current statement. In such uses the ''Learning Standard Item Code'' could be the same for multiple versions of a statement and Learning Standard Item URL could resolve to the most current version of the statement.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12499', '7', '12499')
