VALUES ('001533', 'Assessment Form Algorithm Identifier', NULL, 'An identifier for algorithm used to generate a custom form for an adaptive test.', 'Alphanumeric - 40 characters maximum', '0', 'The algorithm is typically used to generate the entire assessment form, but there may be cases in which it is used to generate only one part (Assessment Form Section).&lt;br/&gt;&lt;br/&gt;CEDS "Identifier" elements reflect the intent of the XSD:Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt; An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12508', '7', '12508')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
VALUES ('001534', 'Assessment Form Algorithm Version', NULL, 'The version of the algorithm used to generate a custom form for an adaptive test.', 'Alphanumeric - 40 characters maximum', '0', 'The algorithm is typically used to generate the entire assessment form, but there may be cases in which it is used to generate only one part (Assessment Form Section).', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12509', '7', '12509')
