VALUES ('001535', 'Assessment Form GUID', NULL, 'The globally unique identifier of an Assessment Form.', 'Alphanumeric - 40 characters maximum', '0', 'CEDS "GUID" elements are defined as RFC 4122 compliant 32-character hexadecimal strings (36 characters with dashes). For example, 21EC2020-3AEA-1069-A2DD-08002B30309D. &lt;br/&gt;&lt;br/&gt;Values MAY be encoded using a hash function such as HMAC-MD5 or HMAC-SHA1, resulting in a string up to 40 characters.', 'https://ceds.ed.gov/CEDSElementDetails.aspx?TermId=12510', '7', '12510')
INSERT INTO dbo.[_CEDSElements]([GlobalID], [ElementName], [AltName], [Definition], [Format], [HasOptionSet], [UsageNotes], [URL], [Version], [TermID])
